import React from 'react';

import './LoginBox.css';
import Paper from '@material-ui/core/Paper';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';



const LoginBox = () => {
    return(
      <Paper>
          <Avatar>
              <LockOutlinedIcon />
          </Avatar>
      </Paper>
    );
};

export default LoginBox;
